import { ReactElement } from 'react';
import { Data, FoodData, Discounts, Items, initialState } from '../Reducers/cartReducer';

export default function Food(props: [string, Items]) {
  const list = props.list;

  return (<div>
  {list.map((element: [string, Items]): ReactElement => {
    const [type, items] = element;
    const itemsName = items.map((item:Items): ReactElement=> {
      const name = item.name;
      return <div key={name}>{name}</div>
    });
    return (
      <div key={type}>
      <div>{type}</div>
      <div>{itemsName}</div>
      </div>
      );})}
  </div>)
}
